import React from 'react';

function Header() {
  return (
    <header className="portfolio-header">
      <img src="/Rowan-Morrison-logo-02.png" alt="Rowan Morrison" className="logo" />
      <h1 className="name">Rowan Morrison</h1>
      <p className="tagline">Multidisciplinary designer & developer based in London.</p>
      <nav className="nav">
        <a href="#work">Work</a>
        <a href="#about">About</a>
        <a href="#contact">Contact</a>
      </nav>
    </header>
  );
}

export default Header;
